import Header from './components/Layout/Header';
import Meals from  './components/Meals/Meals' 
function App() {

  const {state} = useContext(CartContext);
  console.log(state);  

  return (
    <CartProvider>
     {state && <Cart/>}
     <Header />
     <main>
       <Meals/>
     </main>
   </CartProvider>
  );
}

export default App;
